import Admin from "./pages/Admin";
import {ADMIN_ROUTE, HOME_ROUTE, BASKET_ROUTE, DEVICE_ROUTE, LOGIN_ROUTE, REGISTRATION_ROUTE, SHOPE_ISKUS_YELKI_ROUTE, SHOP_ROUTE, FAVORITE_ROUTE, SEARCH_ROUTE, CHECKOUT_ROUTE} from "./utils/consts";
import Basket from "./pages/Basket";
import Shop from "./pages/Shop";
import Auth from "./pages/Auth";
import Favorite from "./pages/Favorite";
import DevicePage from "./pages/DevicePage";
import ShopIskustvenyelki from "./pages/ShopIskustvenyelki";
import Searh from "./pages/Searh";
import Checkout from "./pages/Checkout";
import { Home } from "./pages/Home";

export const authRoutes = [
    {
        path: ADMIN_ROUTE,
        Component: Admin
    },
]

export const publicRoutes = [
    {
        path: HOME_ROUTE,
        Component: Home
    },
    {
        path: CHECKOUT_ROUTE,
        Component: Checkout
    },
    {
        path: SEARCH_ROUTE,
        Component: Searh
    },
    {
        path: FAVORITE_ROUTE,
        Component: Favorite
    },
    {
        path: BASKET_ROUTE,
        Component: Basket
    },
    {
        path: SHOPE_ISKUS_YELKI_ROUTE,
        Component: ShopIskustvenyelki
    },
    {
        path: LOGIN_ROUTE,
        Component: Auth
    },
    {
        path: REGISTRATION_ROUTE,
        Component: Auth
    },
    {
        path: DEVICE_ROUTE + '/:id',
        Component: DevicePage
    },
]
